import react, { Fragment } from "react";
import style from "./Header.module.css";
import headerImg from "../../assets/header-food.jpg";

const Header = () => {
  return (
    <Fragment>
      <header>
        <h1>Mangan Resto</h1>
      </header>
      <div>
        <img src={headerImg} />
      </div>
    </Fragment>
  );
};

export default Header;
